const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }


  return (
    <div>
        <Header course={course}/>
        <Part p={part1.name} e={part1.exercises}/>
        <Part p={part2.name} e={part2.exercises}/>
        <Part p={part3.name} e={part3.exercises}/>
    </div>
  )
}

const Header = (props) =>{
    console.log(props)
    return(
    <div>
        <h1>
            {props.course}
        </h1>
    </div>
    )
}

const Content = (props) =>{
    console.log(props)
    return(
    <div>   
        <Part p={props.part} e={props.e} />
    </div>
)
}

const Part = (props) =>{
    console.log(props)
return(
    <div>
        <p>
            {props.p} {props.e}
        </p>
    </div>
)
}

const Total = (props) =>{
    console.log(props)
    return(
    <div>
        <p>
            number of exercises {props.e1+props.e2+props.e3}
        </p>
    </div>
)
}
export default App
